INSERT INTO pagina VALUES (14, 'Responsabilidade Ambiental', 'responsabilidade-ambiental', '2012-05-17 21:59:27.546146', '2012-05-29 11:48:23.664069', 1, '<h1><span>Rede Sos Turbo - Responsabilidade com o Meio Ambiente</span></h1>
<p>A Rede Sos Turbo tem como um de seus princ&iacute;pios basilares a permanente aten&ccedil;&atilde;o e responsabilidade com o meio ambiente em que vivemos. Consciente de que a natureza &eacute; um bem de todos e que deve ser preservada para as gera&ccedil;&otilde;es futuras, a empresa assume seu compromisso atrav&eacute;s de iniciativas totalmente orientadas para a responsabilidade s&oacute;cio-ambiental, o desenvolvimento sustent&aacute;vel e a qualidade de vida.</p>
<p>S&atilde;o m&uacute;ltiplos os programas desenvolvidos pela Rede Sos Turbo que visam reduzir, reutilizar e reciclar os res&iacute;duos industriais, garantir a preven&ccedil;&atilde;o da polui&ccedil;&atilde;o de suas fontes geradoras, e promover a educa&ccedil;&atilde;o ambiental entre seus colaboradores e a comunidade. Al&eacute;m disso, as a&ccedil;&otilde;es atendem rigorosamente &agrave; legisla&ccedil;&atilde;o em todos os &acirc;mbitos, Federal, Estadual e Municipal.</p>
<p>&nbsp;</p>
<p style="text-align: center;"><img style="margin: 0px auto;" title="Responsabilidade Ambiental." src="../../../../static/images/img-respamb.jpg" alt="Responsabilidade Ambiental." /></p>', 'Responsabilidade Ambiental da Rede SOS Turbo', 'responsabilidade, ambiental, meio ambiente, preservação da natureza', 'N', 'A', NULL, 'N', 'N');
