INSERT INTO pagina VALUES (4, 'Serviços', 'servicos', '2012-08-28 10:03:39.581544', '2012-11-03 18:59:42.704268', 1, '<h1>Servi&ccedil;os</h1>
<ul id="menu_servicos">
<li> <a id="clinica-hipiatria" style="color:#DB4308;" title="Cl&iacute;nica de hipiatria." onclick="return activeTab(this, ''panelClinica'');" href="#">Cl&iacute;nica</a> </li>
<li> <a id="fisioterapia" title="Servi&ccedil;o de fisioterapia." onclick="return activeTab(this, ''panelFisioterapia'');" href="#">Fisioterapia</a> </li>
<li> <a id="cirurgia" title="Cl&iacute;nica de cirurgia." onclick="return activeTab(this, ''panelCirurgia'');" href="#">Cirurgia</a> </li>
<li> <a id="odontologia" title="Cl&iacute;nica de odontologia." onclick="return activeTab(this, ''panelOdontologia'');" href="#">Odontologia</a> </li>
<li> <a id="internacao" title="Cl&iacute;nica de interna&ccedil;&atilde;o." onclick="return activeTab(this, ''panelInternacao'');" href="#">Interna&ccedil;&atilde;o</a> </li>
<li> <a id="atendimento-a-domicilio" title="Servi&ccedil;o de atendimento &agrave; domic&iacute;lio." onclick="return activeTab(this, ''panelAtendimento'');" href="#">Atendimento a Domicilio</a> </li>
<li> <a id="consultoria-a-eventos" title="Servi&ccedil;o de consultoria &agrave; eventos." onclick="return activeTab(this, ''panelConsultoria'');" href="#">Consultoria a Eventos</a> </li>
<li> <a id="formacao-continuada" title="Servi&ccedil;o de forma&ccedil;&atilde;o continuada." onclick="return activeTab(this, ''panelFormacao'');" href="#">Forma&ccedil;&atilde;o Continuada</a> </li>
</ul>
<p id="panelClinica" class="servico_description" style="display:block;">A Equine Clinic disp&otilde;e de M&eacute;dicos Veterin&aacute;rios especialistas em cl&iacute;inica de equinos, com larga experi&ecirc;ncia nesta &aacute;rea, adquirida atrav&eacute;s de anos de trabalho e diversos cursos de aprimoramento. O que faz da Equine Clinic uma refer&ecirc;ncia nesta &aacute;rea.                     <img style="width: 90%; height: 90%; display: block; margin: 0px auto; padding: 05px; background-color: white; border: 01px solid #ccc; margin-top: 10px;" src="../../../static/images/assessoria_.jpg" alt="" /></p>
<p id="panelFisioterapia" class="servico_description">A Equine Clinic tem uma moderna estrutura voltada a fisioterapia, dispondo de t&eacute;cnicas e de aparelhagem de &uacute;ltima gera&ccedil;&atilde;o, proporcionando aos clientes um trabalho diferenciado na fisioterapia e na reabilita&ccedil;&atilde;o de equinos.</p>
<p id="panelCirurgia" class="servico_description">A cirurgia em equinos tem um papel de destaque na Equine Clinic. Com o objetivo de garantir o Bem Estar Animal e a satisfa&ccedil;&atilde;o dos clientes, nos qualificamos para a realiza&ccedil;&atilde;o de cirurgias nas diversas &aacute;reas, como locomotor e g&aacute;strico, entre outros.</p>
<p id="panelOdontologia" class="servico_description">A Equine Clinic presta um servi&ccedil;o de excel&ecirc;ncia na &aacute;rea odontol&oacute;gica, dispondo de moderna aparelhagem, realizando diversos servi&ccedil;os, como ajustes de oclus&atilde;o dent&aacute;ria e at&eacute; extra&ccedil;&otilde;es cir&uacute;rgicas.</p>
<p id="panelInternacao" class="servico_description">A Equine Clinic disp&otilde;e de uma &oacute;tima estrutura de interna&ccedil;&atilde;o para equinos, com baias amplas e ventiladas, contando ainda com estruturas de manejo e conten&ccedil;&atilde;o de equinos. A Equine Clinic ainda conta com uma equipe de apoio capacitada para os plant&otilde;es de interna&ccedil;&atilde;o.</p>
<p id="panelAtendimento" class="servico_description">A equipe da Equine Clinic est&aacute; preparada para este modelo de atendimento, prestando diversos servi&ccedil;os nesta modalidade, favorecendo o conforto do animal e a facilidade do propriet&aacute;rio. A &aacute;rea de atua&ccedil;&atilde;o para atendimento a domicilio est&aacute; restrita aos estados do Rio Grande do Sul e Santa Catarina.</p>
<p id="panelConsultoria" class="servico_description">A Equine Clinic tem desenvolvido diversos trabalhos em Cavalgadas, Rodeios, Concursos H&iacute;picos, Cinema e outros eventos, com atividades cl&iacute;nicas e principalmente na garantia do Bem Estar animal.</p>
<p id="panelFormacao" class="servico_description">A Equine Clinic est&aacute; organizada de maneira a oferecer oportunidades diversas de forma&ccedil;&atilde;o continuada, atrav&eacute;s de work shop, palestras e est&aacute;gios vivenciais, usando a atividade di&aacute;ria da cl&iacute;nica como base pedag&oacute;gica no desenvolvimento deste trabalho.</p>
<p>
<script type="text/javascript">// <![CDATA[
        function activeTab(obj, panel){
            menu = document.getElementById(''menu_servicos'');
            itens = menu.getElementsByTagName(''a'');
            for(var x=0;x<itens.length;x++){
                if (itens[x].id==obj.id){
                    itens[x].style.color=''#DB4308'';
                } else {
                    itens[x].style.color=''blue'';
                }
            }
            left_panel = document.getElementById(''left_panel'');
            pes = left_panel.getElementsByTagName(''p'');
            for(var i=0;i<pes.length;i++){
                if (pes[i].id==panel){
                    //alert(panel);
                    pes[i].style.display=''block'';
                } else {
                    //alert(pes[i]);
                    pes[i].style.display=''none'';
                };
            }
            return false;
        }
// ]]></script>
</p>', 'Clínica de Hipiatria, com serviços de cirurgia e fisioterapia em Viamão - RS', 'hipiatria, clinica, cirurgia, fisioterapia, equino', 'N', 'A', NULL, 'S', 'N');
INSERT INTO pagina VALUES (6, 'Quem Somos', 'quem-somos', '2012-05-17 21:36:18.197956', '2012-11-03 18:50:42.819442', 1, '<h1>A Empresa</h1>
<p>Somos uma cl&iacute;nica veterin&aacute;ria especializada no atendimento a equinos de diversas ra&ccedil;as e finalidades, h&aacute; mais de 5 anos no mercado de Equinos. A Equine Clinic &eacute; composta por dois m&eacute;dicos veterin&aacute;rios, especialistas em Hipiatria, e ainda conta com a participa&ccedil;&atilde;o de outros m&eacute;dicos veterin&aacute;rios, em distintas &aacute;reas da Hipiatria, com a finalidade de prestar servi&ccedil;os t&eacute;cnicos especializados, como nas &aacute;reas de Diagn&oacute;stico por imagem, por exemplo.</p>
<p>Com a finalidade de atender a crescente demanda do mercado de equinos, principalmente no que se refere aos equinos como animal de companhia, a Equine Clinic oferece diversos servi&ccedil;os como Cl&iacute;nica, Cirugia, Fisioterapia, Odontologia e ainda Emerg&ecirc;ncias e Interna&ccedil;&atilde;o hospitalar.</p>
<p>&nbsp;</p>
<div id="painel_fotos"><a title="Foto da EquineClinic." href="../../../static/images/clinica_01.jpg"><img title="Foto da EquineClinic." src="../../../static/images/clinica_01_thumb.jpg" alt="Foto da EquineClinic." /></a> <a title="Foto da EquineClinic." href="../../../static/images/clinica_02.jpg"><img title="Foto da EquineClinic." src="../../../static/images/clinica_02_thumb.jpg" alt="Foto da EquineClinic." /></a> <a title="Foto da EquineClinic." href="../../../static/images/clinica_03.jpg"><img title="Foto da EquineClinic." src="../../../static/images/clinica_03_thumb.jpg" alt="Foto da EquineClinic." /></a> <a title="Foto da EquineClinic." href="../../../static/images/clinica_04.jpg"><img title="Foto da EquineClinic." src="../../../static/images/clinica_04_thumb.jpg" alt="Foto da EquineClinic." /></a> <a title="Foto da EquineClinic." href="../../../static/images/clinica_05.jpg"><img title="Foto da EquineClinic." src="../../../static/images/clinica_05_thumb.jpg" alt="Foto da EquineClinic." /></a> <a title="Foto da EquineClinic." href="../../../static/images/clinica_06.jpg"><img title="Foto da EquineClinic." src="../../../static/images/clinica_06_thumb.jpg" alt="Foto da EquineClinic." /></a> <br /> <a title="Foto da EquineClinic." href="../../../static/images/clinica_07.jpg"><img title="Foto da EquineClinic." src="../../../static/images/clinica_07_thumb.jpg" alt="Foto da EquineClinic." /></a> <a title="Foto da EquineClinic." href="../../../static/images/clinica_08.jpg"><img title="Foto da EquineClinic." src="../../../static/images/clinica_08_thumb.jpg" alt="Foto da EquineClinic." /></a> <a title="Foto da EquineClinic." href="../../../static/images/clinica_09.jpg"><img title="Foto da EquineClinic." src="../../../static/images/clinica_09_thumb.jpg" alt="Foto da EquineClinic." /></a> <a title="Foto da EquineClinic." href="../../../static/images/clinica_10.jpg"><img title="Foto da EquineClinic." src="../../../static/images/clinica_10_thumb.jpg" alt="Foto da EquineClinic." /></a> <a title="Foto da EquineClinic." href="../../../static/images/clinica_11.jpg"><img title="Foto da EquineClinic." src="../../../static/images/clinica_11_thumb.jpg" alt="Foto da EquineClinic." /></a> <a title="Foto da EquineClinic." href="../../../static/images/clinica_12.jpg"><img title="Foto da EquineClinic." src="../../../static/images/clinica_12_thumb.jpg" alt="Foto da EquineClinic." /></a> <br /> <span>Clique na foto para ampliar.</span></div>
<p>
