INSERT INTO pagina VALUES (217, 'Veterinários', 'veterinarios', '2012-11-03 18:54:39.031313', '2012-11-03 18:54:39.031313', 1, '<h1>Veterin&aacute;rios</h1>
<p><strong>Alexandre Carvalho Monteverde</strong> CRMV RS 05344, formado pela Universidade Federal do Rio Grande do Sul, especialista em equinos, atuando nas &aacute;reas de cl&iacute;nica, cirurgia e odontologia. Sempre trabalhando com equinos, atuou no Jockey Club do Rio Grande do Sul, Sociedade H&iacute;pica Porto Alegrense, e em diversos Haras e Cabanhas do Rio Grande do Sul e Santa Catarina.</p>
<p><strong>Henrique dos Reis Noronha</strong> CRMV RS 09144, formado pela Universidade Luterana do Rio Grande do Sul, especialista em equinos, atuando nas &aacute;reas de cl&iacute;nica, odontologia e fisioterapia. Sempre voltado a cl&iacute;nica de equinos, trabalhou no Jockey Club do Rio Grande do Sul, na Sociedade H&iacute;pica Porto Alegrense, e na Ferme 7 Chutes em Queb&eacute;c, Canad&aacute;, e ainda em diversos Haras e Cabanhas do Rio Grande do Sul.</p>', 'Clínica de Hipiatria, com serviços de cirurgia e fisioterapia em Viamão - RS', 'veterinarios, pessoal técnico, especialistas', 'N', 'A', NULL, 'S', 'N');
