INSERT INTO pagina VALUES (219, 'Parceiros', 'parceiros', '2012-11-03 19:48:07.03204', '2012-11-03 19:48:07.03204', 1, '<h1>Parceiros</h1>
<p>A Equine Clinic tem desenvolvido parcerias com Laborat&oacute;rios e outras empresas do setor da Equinocultura, a fim de promover o interc&acirc;mbio e o desenvolvimento de tecnologia que favore&ccedil;am a Sa&uacute;de e o Bem Estar Animal.</p>', 'Clínica de Hipiatria, com serviços de cirurgia e fisioterapia em Viamão - RS', 'parceiros', 'N', 'A', NULL, 'S', 'N');


