INSERT INTO publicacao VALUES (1, 'Convênio com o Qualittas', 'conv-nio-com-o-qualittas', '2012-05-02 15:30:44', 1, '2012-05-02 15:30:51', 'noticia, convênio, qualittas', '<p>A Equine Clinic e o Qualittas &ndash; Instituto de P&oacute;s-gradua&ccedil;&atilde;o fecham conv&ecirc;nio para realiza&ccedil;&atilde;o de cursos ligados a Equinocultura, nos moldes de capacita&ccedil;&atilde;o, aperfei&ccedil;oamento e P&oacute;s-gradua&ccedil;&atilde;o.</p>', '<p>A Equine Clinic e o Qualittas &ndash; Instituto de P&oacute;s-gradua&ccedil;&atilde;o fecham conv&ecirc;nio para realiza&ccedil;&atilde;o de cursos ligados a Equinocultura, nos moldes de capacita&ccedil;&atilde;o, aperfei&ccedil;oamento e P&oacute;s-gradua&ccedil;&atilde;o.</p>
<p>As duas institui&ccedil;&otilde;es passam a somar for&ccedil;as no intuito de difundir o conhecimento nesta crescente &aacute;rea, com foco em M&eacute;dicos Veterin&aacute;rios e tamb&eacute;m acad&ecirc;micos de Medicina Veterin&aacute;ria. Os cursos poder&atilde;o utilizar as estruturas das duas institui&ccedil;&otilde;es, favorecendo um melhor desempenho do ponto de vista pedag&oacute;gico, integrando a teoria e a pr&aacute;tica, associada &agrave; rotina cl&iacute;nica da Equine Clinic, e o &ldquo;know how&rdquo; do Qualittas no ensino da Medicina Veterin&aacute;ria.</p>
<p>Os primeiro frutos deste conv&ecirc;nio j&aacute; devem surgir no mercado ainda em julho, com cursos nas &aacute;reas de Odontologia Equina, Organiza&ccedil;&atilde;o de Eventos Equestres &ndash; Bem estar e Responsabilidade T&eacute;cnica, e diversos outros, ainda em fase "embrion&aacute;ria".</p>', 'http://www.equineclinic.com.br/static/images/icone.png', 'Sem Galeria', 'S', 'N', 'A', NULL, 'N', 'N');


